import React, { useState, useEffect } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { useTickets } from '../context/TicketsContext';

function AdminDashboard() {
  const { user, logout, generateAdminAccount } = useAuth();
  const { tickets, stats, loading, error, fetchTickets } = useTickets();
  const navigate = useNavigate();
  
  // State for admin generation modal
  const [showModal, setShowModal] = useState(false);
  const [newAdminName, setNewAdminName] = useState('');
  const [newAdminRole, setNewAdminRole] = useState('admin');
  const [generatedAdmin, setGeneratedAdmin] = useState(null);
  
  // Filter states
  const [categoryFilter, setCategoryFilter] = useState('all');
  const [priorityFilter, setPriorityFilter] = useState('all');
  const [statusFilter, setStatusFilter] = useState('all');
  const [searchQuery, setSearchQuery] = useState('');
  
  // Refresh tickets on mount
  useEffect(() => {
    fetchTickets();
  }, [fetchTickets]);
  
  // Apply filters to tickets
  const filteredTickets = tickets.filter(ticket => {
    // Apply category filter
    if (categoryFilter !== 'all' && ticket.category !== categoryFilter) {
      return false;
    }
    
    // Apply priority filter
    if (priorityFilter !== 'all' && ticket.priority !== priorityFilter) {
      return false;
    }
    
    // Apply status filter
    if (statusFilter !== 'all' && ticket.status !== statusFilter) {
      return false;
    }
    
    // Apply search query
    if (searchQuery) {
      const query = searchQuery.toLowerCase();
      return (
        ticket.text.toLowerCase().includes(query) ||
        ticket.subject.toLowerCase().includes(query) ||
        ticket.ticket_id.toLowerCase().includes(query) ||
        (ticket.customer_name && ticket.customer_name.toLowerCase().includes(query))
      );
    }
    
    return true;
  });
  
  // Handle admin generation
  const handleGenerateAdmin = (e) => {
    e.preventDefault();
    if (!newAdminName) return;
    
    const admin = generateAdminAccount(newAdminName, newAdminRole);
    setGeneratedAdmin(admin);
  };
  
  // Handle logout
  const handleLogout = () => {
    logout();
    navigate('/login');
  };
  
  // Get count by priority
  const getCountByPriority = (priority) => {
    return stats.byPriority?.[priority] || 0;
  };
  
  // Get count by category
  const getCountByCategory = (category) => {
    return stats.byCategory?.[category] || 0;
  };
  
  // Get color class for priority
  const getPriorityColorClass = (priority) => {
    switch (priority) {
      case 'critical':
        return 'bg-red-100 text-red-800';
      case 'high':
        return 'bg-orange-100 text-orange-800';
      case 'medium':
        return 'bg-yellow-100 text-yellow-800';
      case 'low':
        return 'bg-green-100 text-green-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };
  
  // Get color class for category
  const getCategoryColorClass = (category) => {
    switch (category) {
      case 'bug':
        return 'bg-red-100 text-red-800';
      case 'feature':
        return 'bg-purple-100 text-purple-800';
      case 'query':
        return 'bg-blue-100 text-blue-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };
  
  // Get status badge class
  const getStatusBadgeClass = (status) => {
    switch (status) {
      case 'open':
        return 'bg-blue-100 text-blue-800';
      case 'in_progress':
        return 'bg-yellow-100 text-yellow-800';
      case 'resolved':
        return 'bg-green-100 text-green-800';
      case 'closed':
        return 'bg-gray-100 text-gray-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };
  
  return (
    <div className="min-h-screen bg-gray-100">
      {/* Header */}
      <header className="bg-white shadow">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-4 flex items-center justify-between">
          <div className="flex items-center">
            <h1 className="text-2xl font-bold text-gray-900">Admin Dashboard</h1>
            <span className="ml-4 px-3 py-1 bg-blue-100 text-blue-800 text-xs font-medium rounded-full">
              {user?.role === 'admin' ? 'Administrator' : 'Support Manager'}
            </span>
          </div>
          <div className="flex items-center space-x-4">
            <button
              onClick={() => setShowModal(true)}
              className="inline-flex items-center px-3 py-1.5 border border-transparent text-sm font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700 focus:outline-none"
            >
              Generate Admin
            </button>
            <div className="relative">
              <button 
                onClick={handleLogout}
                className="inline-flex items-center px-3 py-1.5 border border-gray-300 text-sm font-medium rounded-md text-gray-700 bg-white hover:bg-gray-50 focus:outline-none"
              >
                Logout
              </button>
            </div>
          </div>
        </div>
      </header>
      
      <main className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-6">
        {/* Admin generation modal */}
        {showModal && (
          <div className="fixed inset-0 bg-gray-500 bg-opacity-75 flex items-center justify-center z-50">
            <div className="bg-white rounded-lg overflow-hidden shadow-xl max-w-md w-full">
              <div className="px-6 py-4 bg-blue-600 text-white">
                <h3 className="text-lg font-medium">Generate Admin Account</h3>
              </div>
              
              {generatedAdmin ? (
                <div className="p-6">
                  <div className="bg-green-50 border-l-4 border-green-400 p-4 mb-4">
                    <div className="flex">
                      <div className="flex-shrink-0">
                        <svg className="h-5 w-5 text-green-400" fill="currentColor" viewBox="0 0 20 20">
                          <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zm3.707-9.293a1 1 0 00-1.414-1.414L9 10.586 7.707 9.293a1 1 0 00-1.414 1.414l2 2a1 1 0 001.414 0l4-4z" clipRule="evenodd" />
                        </svg>
                      </div>
                      <div className="ml-3">
                        <p className="text-sm text-green-800">Admin account generated successfully!</p>
                      </div>
                    </div>
                  </div>
                  
                  <dl className="space-y-2">
                    <div>
                      <dt className="text-sm font-medium text-gray-500">Admin ID</dt>
                      <dd className="mt-1 text-sm text-gray-900 font-mono bg-gray-100 p-2 rounded">{generatedAdmin.id}</dd>
                    </div>
                    <div>
                      <dt className="text-sm font-medium text-gray-500">Name</dt>
                      <dd className="mt-1 text-sm text-gray-900">{generatedAdmin.name}</dd>
                    </div>
                    <div>
                      <dt className="text-sm font-medium text-gray-500">Role</dt>
                      <dd className="mt-1 text-sm text-gray-900">{generatedAdmin.role}</dd>
                    </div>
                    <div>
                      <dt className="text-sm font-medium text-gray-500">Temporary Password</dt>
                      <dd className="mt-1 text-sm text-gray-900 font-mono bg-gray-100 p-2 rounded">{generatedAdmin.password}</dd>
                    </div>
                  </dl>
                  
                  <div className="bg-yellow-50 border-l-4 border-yellow-400 p-4 mt-4">
                    <div className="flex">
                      <div className="flex-shrink-0">
                        <svg className="h-5 w-5 text-yellow-400" fill="currentColor" viewBox="0 0 20 20">
                          <path fillRule="evenodd" d="M8.257 3.099c.765-1.36 2.722-1.36 3.486 0l5.58 9.92c.75 1.334-.213 2.98-1.742 2.98H4.42c-1.53 0-2.493-1.646-1.743-2.98l5.58-9.92zM11 13a1 1 0 11-2 0 1 1 0 012 0zm-1-8a1 1 0 00-1 1v3a1 1 0 002 0V6a1 1 0 00-1-1z" clipRule="evenodd" />
                        </svg>
                      </div>
                      <div className="ml-3">
                        <p className="text-sm text-yellow-800">
                          Please save these credentials securely. The password will not be shown again.
                        </p>
                      </div>
                    </div>
                  </div>
                  
                  <div className="mt-6 flex justify-end">
                    <button
                      onClick={() => {
                        setShowModal(false);
                        setGeneratedAdmin(null);
                        setNewAdminName('');
                        setNewAdminRole('admin');
                      }}
                      className="inline-flex justify-center px-4 py-2 text-sm font-medium text-white bg-blue-600 border border-transparent rounded-md hover:bg-blue-700 focus:outline-none"
                    >
                      Close
                    </button>
                  </div>
                </div>
              ) : (
                <form onSubmit={handleGenerateAdmin} className="p-6">
                  <div className="mb-4">
                    <label htmlFor="adminName" className="block text-sm font-medium text-gray-700">Admin Name</label>
                    <input
                      type="text"
                      id="adminName"
                      value={newAdminName}
                      onChange={(e) => setNewAdminName(e.target.value)}
                      className="mt-1 block w-full border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
                      required
                    />
                  </div>
                  
                  <div className="mb-4">
                    <label htmlFor="adminRole" className="block text-sm font-medium text-gray-700">Role</label>
                    <select
                      id="adminRole"
                      value={newAdminRole}
                      onChange={(e) => setNewAdminRole(e.target.value)}
                      className="mt-1 block w-full border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
                    >
                      <option value="admin">Administrator</option>
                      <option value="manager">Support Manager</option>
                    </select>
                  </div>
                  
                  <div className="mt-6 flex justify-end space-x-3">
                    <button
                      type="button"
                      onClick={() => setShowModal(false)}
                      className="inline-flex justify-center px-4 py-2 text-sm font-medium text-gray-700 bg-white border border-gray-300 rounded-md shadow-sm hover:bg-gray-50 focus:outline-none"
                    >
                      Cancel
                    </button>
                    <button
                      type="submit"
                      className="inline-flex justify-center px-4 py-2 text-sm font-medium text-white bg-blue-600 border border-transparent rounded-md shadow-sm hover:bg-blue-700 focus:outline-none"
                    >
                      Generate
                    </button>
                  </div>
                </form>
              )}
            </div>
          </div>
        )}
        
        {/* Stats overview */}
        <div className="mb-6">
          <h2 className="text-lg font-medium text-gray-900 mb-3">Overview</h2>
          <div className="grid grid-cols-1 gap-5 sm:grid-cols-2 lg:grid-cols-4">
            {/* Total tickets */}
            <div className="bg-white overflow-hidden shadow rounded-lg">
              <div className="px-4 py-5 sm:p-6">
                <dt className="text-sm font-medium text-gray-500 truncate">Total Tickets</dt>
                <dd className="mt-1 text-3xl font-semibold text-gray-900">{stats.totalTickets || 0}</dd>
              </div>
            </div>
            
            {/* Critical tickets */}
            <div className="bg-white overflow-hidden shadow rounded-lg">
              <div className="px-4 py-5 sm:p-6">
                <dt className="text-sm font-medium text-gray-500 truncate">Critical Priority</dt>
                <dd className="mt-1 text-3xl font-semibold text-red-600">{getCountByPriority('critical')}</dd>
              </div>
            </div>
            
            {/* Bug tickets */}
            <div className="bg-white overflow-hidden shadow rounded-lg">
              <div className="px-4 py-5 sm:p-6">
                <dt className="text-sm font-medium text-gray-500 truncate">Bug Reports</dt>
                <dd className="mt-1 text-3xl font-semibold text-gray-900">{getCountByCategory('bug')}</dd>
              </div>
            </div>
            
            {/* Feature requests */}
            <div className="bg-white overflow-hidden shadow rounded-lg">
              <div className="px-4 py-5 sm:p-6">
                <dt className="text-sm font-medium text-gray-500 truncate">Feature Requests</dt>
                <dd className="mt-1 text-3xl font-semibold text-gray-900">{getCountByCategory('feature')}</dd>
              </div>
            </div>
          </div>
        </div>
        
        {/* AI Insights */}
        <div className="mb-6">
          <h2 className="text-lg font-medium text-gray-900 mb-3">AI Insights</h2>
          <div className="bg-white overflow-hidden shadow rounded-lg">
            <div className="px-4 py-5 sm:p-6">
              <div className="grid grid-cols-1 gap-5 sm:grid-cols-3">
                {/* Priority Distribution */}
                <div>
                  <h3 className="text-sm font-medium text-gray-500">Priority Distribution</h3>
                  <ul className="mt-3 space-y-2">
                    {['critical', 'high', 'medium', 'low'].map(priority => (
                      <li key={priority} className="flex items-center justify-between">
                        <div className="flex items-center">
                          <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${getPriorityColorClass(priority)}`}>
                            {priority}
                          </span>
                        </div>
                        <div className="flex items-center">
                          <span className="text-sm text-gray-900 font-medium">{getCountByPriority(priority)}</span>
                          <span className="ml-1 text-sm text-gray-500">
                            ({stats.totalTickets ? Math.round((getCountByPriority(priority) / stats.totalTickets) * 100) : 0}%)
                          </span>
                        </div>
                      </li>
                    ))}
                  </ul>
                </div>
                
                {/* Category Distribution */}
                <div>
                  <h3 className="text-sm font-medium text-gray-500">Category Distribution</h3>
                  <ul className="mt-3 space-y-2">
                    {['bug', 'feature', 'query'].map(category => (
                      <li key={category} className="flex items-center justify-between">
                        <div className="flex items-center">
                          <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${getCategoryColorClass(category)}`}>
                            {category}
                          </span>
                        </div>
                        <div className="flex items-center">
                          <span className="text-sm text-gray-900 font-medium">{getCountByCategory(category)}</span>
                          <span className="ml-1 text-sm text-gray-500">
                            ({stats.totalTickets ? Math.round((getCountByCategory(category) / stats.totalTickets) * 100) : 0}%)
                          </span>
                        </div>
                      </li>
                    ))}
                  </ul>
                </div>
                
                {/* AI Recommendations */}
                <div>
                  <h3 className="text-sm font-medium text-gray-500">AI Recommendations</h3>
                  <ul className="mt-3 space-y-2">
                    {getCountByPriority('critical') > 0 && (
                      <li className="text-sm text-red-700 bg-red-50 p-2 rounded">
                        <strong>{getCountByPriority('critical')} critical issues</strong> require immediate attention
                      </li>
                    )}
                    {getCountByCategory('bug') > getCountByCategory('feature') && (
                      <li className="text-sm text-blue-700 bg-blue-50 p-2 rounded">
                        Focus on bug fixing over new features
                      </li>
                    )}
                    {getCountByPriority('high') + getCountByPriority('critical') > 
                     getCountByPriority('medium') + getCountByPriority('low') && (
                      <li className="text-sm text-yellow-700 bg-yellow-50 p-2 rounded">
                        High number of urgent tickets may indicate system stability issues
                      </li>
                    )}
                    {getCountByCategory('query') > (getCountByCategory('bug') + getCountByCategory('feature')) * 0.5 && (
                      <li className="text-sm text-green-700 bg-green-50 p-2 rounded">
                        Consider updating documentation to reduce user queries
                      </li>
                    )}
                  </ul>
                </div>
              </div>
            </div>
          </div>
        </div>
        
        {/* Tickets table */}
        <div className="mb-6">
          <div className="flex justify-between items-center mb-3">
            <h2 className="text-lg font-medium text-gray-900">Support Tickets</h2>
            <button
              onClick={fetchTickets}
              className="inline-flex items-center px-3 py-1.5 border border-gray-300 shadow-sm text-sm font-medium rounded-md text-gray-700 bg-white hover:bg-gray-50 focus:outline-none"
            >
              <svg className="h-4 w-4 mr-1" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 4v5h.582m15.356 2A8.001 8.001 0 004.582 9m0 0H9m11 11v-5h-.581m0 0a8.003 8.003 0 01-15.357-2m15.357 2H15" />
              </svg>
              Refresh
            </button>
          </div>
          
          {/* Filters */}
          <div className="bg-white p-4 rounded-lg shadow mb-4">
            <div className="grid grid-cols-1 gap-4 sm:grid-cols-4">
              {/* Search */}
              <div>
                <label htmlFor="search" className="block text-sm font-medium text-gray-700 sr-only">Search</label>
                <div className="relative">
                  <div className="absolute inset-y-0 left-0 pl-3 flex items-center pointer-events-none">
                    <svg className="h-5 w-5 text-gray-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" />
                    </svg>
                  </div>
                  <input
                    type="text"
                    id="search"
                    className="block w-full pl-10 pr-3 py-2 border border-gray-300 rounded-md leading-5 bg-white placeholder-gray-500 focus:outline-none focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
                    placeholder="Search tickets"
                    value={searchQuery}
                    onChange={(e) => setSearchQuery(e.target.value)}
                  />
                </div>
              </div>
              
              {/* Category filter */}
              <div>
                <label htmlFor="category" className="block text-sm font-medium text-gray-700">Category</label>
                <select
                  id="category"
                  className="mt-1 block w-full py-2 px-3 border border-gray-300 bg-white rounded-md shadow-sm focus:outline-none focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
                  value={categoryFilter}
                  onChange={(e) => setCategoryFilter(e.target.value)}
                >
                  <option value="all">All Categories</option>
                  <option value="bug">Bug</option>
                  <option value="feature">Feature</option>
                  <option value="query">Query</option>
                </select>
              </div>
              
              {/* Priority filter */}
              <div>
                <label htmlFor="priority" className="block text-sm font-medium text-gray-700">Priority</label>
                <select
                  id="priority"
                  className="mt-1 block w-full py-2 px-3 border border-gray-300 bg-white rounded-md shadow-sm focus:outline-none focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
                  value={priorityFilter}
                  onChange={(e) => setPriorityFilter(e.target.value)}
                >
                  <option value="all">All Priorities</option>
                  <option value="critical">Critical</option>
                  <option value="high">High</option>
                  <option value="medium">Medium</option>
                  <option value="low">Low</option>
                </select>
              </div>
              
              {/* Status filter */}
              <div>
                <label htmlFor="status" className="block text-sm font-medium text-gray-700">Status</label>
                <select
                  id="status"
                  className="mt-1 block w-full py-2 px-3 border border-gray-300 bg-white rounded-md shadow-sm focus:outline-none focus:ring-blue-500 focus:border-blue-500 sm:text-sm"
                  value={statusFilter}
                  onChange={(e) => setStatusFilter(e.target.value)}
                >
                  <option value="all">All Statuses</option>
                  <option value="open">Open</option>
                  <option value="in_progress">In Progress</option>
                  <option value="resolved">Resolved</option>
                  <option value="closed">Closed</option>
                </select>
              </div>
            </div>
          </div>
          
          {/* Tickets list */}
          <div className="bg-white shadow overflow-hidden rounded-lg">
            {loading ? (
              <div className="p-10 flex justify-center">
                <svg className="animate-spin h-10 w-10 text-blue-500" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24">
                  <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4"></circle>
                  <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8V0C5.373 0 0 5.373 0 12h4zm2 5.291A7.962 7.962 0 014 12H0c0 3.042 1.135 5.824 3 7.938l3-2.647z"></path>
                </svg>
              </div>
            ) : error ? (
              <div className="p-6 text-center text-red-500">{error}</div>
            ) : filteredTickets.length === 0 ? (
              <div className="p-6 text-center text-gray-500">No tickets found matching your filters</div>
            ) : (
              <div className="overflow-x-auto">
                <table className="min-w-full divide-y divide-gray-200">
                  <thead className="bg-gray-50">
                    <tr>
                      <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                        Ticket ID
                      </th>
                      <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                        Subject
                      </th>
                      <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                        Customer
                      </th>
                      <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                        Category
                      </th>
                      <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                        Priority
                      </th>
                      <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                        Status
                      </th>
                      <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                        Actions
                      </th>
                    </tr>
                  </thead>
                  <tbody className="bg-white divide-y divide-gray-200">
                    {filteredTickets.map(ticket => (
                      <tr key={ticket.ticket_id} className="hover:bg-gray-50">
                        <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">
                          {ticket.ticket_id}
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                          {ticket.subject}
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                          {ticket.customer_name || 'Anonymous'}
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap">
                          <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${getCategoryColorClass(ticket.category)}`}>
                            {ticket.category}
                          </span>
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap">
                          <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${getPriorityColorClass(ticket.priority)}`}>
                            {ticket.priority}
                          </span>
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap">
                          <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${getStatusBadgeClass(ticket.status)}`}>
                            {ticket.status?.replace('_', ' ')}
                          </span>
                        </td>
                        <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                          <Link
                            to={`/admin/tickets/${ticket.ticket_id}`}
                            className="text-blue-600 hover:text-blue-900"
                          >
                            View
                          </Link>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            )}
          </div>
        </div>
      </main>
    </div>
  );
}

export default AdminDashboard;
